import React from 'react'
import './style/ed.css'

const EarthDay = () =>{
    return(
        <>
            <div className="Body" id='EarthDay-B'>
                <div className="tophead-ED">
                    <h1 className="h1 text-bold" style={{fontWeight:'bolder', letterSpacing:'0.2vw'}}>EARTH DAY</h1>
                </div>
                div.bottom
            </div>
        </>
    )
}

export { EarthDay }
